INSERT INTO `buku` (`Id_Buku`, `Judul`, `Penulis`, `Penerbit`, `Tahun_Terbit`, `Cover`, `Deskripsi`) VALUES
(15, 'fullmetal alchemist ', 'Seiji Mizushima', 'bones', '2020-02-24', , 'ico Edward Elric dan Alphonse Elric awalnya hidup bahagia dengan orang tua mereka. Tetapi karena pekerjaan ayahnya adalah alkemist (ahli kimia), ayahnya yang bernama Van Hohenheim sering bepergian keluar rumah, sehingga Ed dan Al hanya tinggal bersama ibunya, Trisha Elric. Karena terlalu lelah mengurus rumah sendirian, Trisha jatuh sakit dan akhirnya meninggal. Ed dan Al yang saat itu masih kecil, namun sudah mewarisi bakat ayahnya sebagai alkemist mencoba menghidupkan kembali sang ibu. Namun, usaha mereka gagal. Tubuh Al dan kaki kiri Ed diambil sebagai \"biaya masuk\" karena transmutasi manusia adalah hal tabu dalam alkimia. Ed yang panik akhirnya memindahkan roh Al ke dalam baju zirah dengan bayaran tangan kanannya.\r\n\r\nDi tengah keputusasaannya, Ed mendapat tawaran untuk menjadi seorang alchemist kenegaraan (State Alchemist). setelah mempertimbangkan keuntungan memperoleh berbagai hak istimewa sehingga ia bisa menyelidiki dan mencari cara untuk mengembalikan tubuh mereka, Ed menerima tawaran itu. Tangan dan kaki Ed pun diganti dengan automail. Setelah itu, Ed mengikuti tes ujian alchemist kenegaraan dan lulus sebagai alchemist kenegaraan termuda dalam sejarah dan mendapat julukan Fullmetal Alchemist. Bersama dengan Al, dimulailah petualangan Ed guna mencari cara untuk mengembalikan tubuh mereka.');
INSERT INTO `buku` (`Id_Buku`, `Judul`, `Penulis`, `Penerbit`, `Tahun_Terbit`, `Cover`, `Deskripsi`) VALUES
(16, 'Gokurakugai', 'yuto sano', 'shueisha', '2024-02-24', , 'Info tentang Gokurakugai, Manga Shonen Baru yang Siap Menjadi Komik Jepang Besar Selanjutnya. Teras Info - Ditulis oleh Yuto Sano dan diserialkan di Jump Square sejak Juli 2022, Gokurakugai adalah serial manga pemburu setan baru yang diunggulkan oleh Shueisha.');
INSERT INTO `buku` (`Id_Buku`, `Judul`, `Penulis`, `Penerbit`, `Tahun_Terbit`, `Cover`, `Deskripsi`) VALUES
(17, 'kimi no todoke', 'naoto', 'toho', '2014-02-24', , 'Sawako Kuronuma selalu dihindari oleh teman-teman sekelasnya karena namanya menyerupai \"Sadako\", karakter utama dalam film horor 1998 Ring. Mereka percaya bahwa ketika seseorang menatap mata Sawako selama lebih dari tiga detik, nasib buruk akan menimpa orang tersebut. Mereka juga percaya bahwa dia bisa memanggil hantu. Rumor ini semakin memburuk karena Sawako tidak dapat mengekspresikan pendapatnya secara terbuka. Namun, dalam kenyataannya Sawako adalah orang yang baik dengan moto hidupnya adalah \"melakukan satu hal yang baik sekali sehari\". Shota Kazehaya, di sisi lain, adalah seorang siswa yang populer dikalangan teman sekolahnya, terutama anak perempuan.\r\n\r\nPada hari pertama sekolah, Sawako membantu Kazehaya, yang tersesat, untuk menemukan jalan ke sekolah. Sejak hari itu, Kazehaya memperlakukan Sawako dengan baik, menghormati Sawako dan mengaguminya. Sawako juga berteman baik dengannya dan teman sekelasnya Chizuru Yoshida dan Ayane Yano setelah dia setuju untuk berperan sebagai hantu dalam \"uji nyali\" kelas mereka untuk mengisi liburan . Dengan bantuan mereka, ia berhasil mendapatkan kepercayaan diri dan berinteraksi lebih baik dengan teman sekelasnya. Desas-desus tentang dia juga mulai mereda. Namun, Ume Kurumizawa, pengagum Kazehaya, mulai menjadi iri karena Sawako diperlakukan dengan baik oleh Kazehaya.');
INSERT INTO `buku` (`Id_Buku`, `Judul`, `Penulis`, `Penerbit`, `Tahun_Terbit`, `Cover`, `Deskripsi`) VALUES
(18, 'kimetsu no yaiba', 'koyoharu', 'shueisha', '2018-02-24', , 'Berlatar di Jepang pada zaman Taisho, Tanjiro Kamado adalah seorang bocah lelaki baik hati dan cerdas yang tinggal bersama keluarganya dan mencari uang dengan cara menjual arang. Semuanya berubah ketika keluarganya diserang dan dibantai oleh iblis (oni). Tanjiro dan saudarinya Nezuko adalah satu-satunya yang selamat dari insiden tersebut, meskipun Nezuko sekarang telah berubah menjadi iblis—tetapi secara mengejutkan dia masih menunjukkan tanda-tanda emosi dan pemikiran layaknya seorang manusia. Tanjiro kemudian menjadi pembasmi iblis untuk mengembalikan Nezuko menjadi manusia lagi, dan untuk mencegah tragedi yang terjadi pada dia dan adiknya terulang pada orang lain.');
INSERT INTO `buku` (`Id_Buku`, `Judul`, `Penulis`, `Penerbit`, `Tahun_Terbit`, `Cover`, `Deskripsi`) VALUES
(19, 'komi-san cant communicate', 'tomohido oda', 'shogakugan', '2019-06-24', , 'Pada hari pertamanya masuk SMA Swasta Itan, Shouko Komi langsung menerima popularitas yang luar biasa karena kecantikannya yang bersahaja dan halus serta keanggunan yang menurut teman-teman sekelasnya sangat sempurna. Namun, hanya Hitohito Tadano—seorang anak sekolah berkemampuan rata-rata yang duduk di sebelahnya—yang memiliki kesempatan untuk menyadari bahwa di balik penampilan bishōjo-nya, Komi memiliki masalah serius dalam berkomunikasi dengan orang lain. Tadano berupaya untuk membantu Komi dalam usahanya untuk mendapatkan 100 teman.');
INSERT INTO `buku` (`Id_Buku`, `Judul`, `Penulis`, `Penerbit`, `Tahun_Terbit`, `Cover`, `Deskripsi`) VALUES
(20, 'umebeno estranger', 'kanna kii', 'shodensha', '2017-02-24', , 'Shun Hashimoto adalah seorang novelis gay yang tinggal di Okinawa yang bertemu dengan Mio Chibana, seorang siswa sekolah menengah yatim piatu yang tinggal bersama kerabatnya setelah kematian ibunya. Namun, reaksi Mio terhadap Shun yang menghubunginya mengingatkannya pada keterasingan dari orang tuanya setelah mereka mengetahui orientasi seksualnya. Saat Shun dan Mio semakin dekat, Mio mengaku bahwa dia akan pindah ke kota, namun berjanji untuk tetap berhubungan begitu sampai di sana.\r\n\r\nTiga tahun kemudian, Mio tiba-tiba mundur dan mengaku dia jatuh cinta dengan Shun, tapi Shun diliputi rasa bersalah karena merampas kehidupan \"normal\" dia. Sementara itu, teman masa kecil dan mantan tunangan Shun, Sakurako, tiba di pulau itu untuk membujuknya agar kembali ke Hokkaido karena kesehatan ayahnya yang buruk. Shun bersikeras untuk tetap bersama Mio, tapi Mio mendesaknya untuk kembali untuk berdamai dengan keluarganya. Menyadari Mio benar-benar mencintainya dan merasakan kebenaran dalam kata-katanya, Shun memutuskan untuk kembali ke Hokkaido dan meminta Mio untuk menemaninya.');
INSERT INTO `buku` (`Id_Buku`, `Judul`, `Penulis`, `Penerbit`, `Tahun_Terbit`, `Cover`, `Deskripsi`) VALUES
(21, 'a sign of affection', 'suu morishita', 'kodansha', '2019-02-13', , 'Yuki Itose adalah seorang mahasiswa dengan gangguan pendengaran bawaan. Selain bahasa isyarat, ia berkomunikasi melalui teks dan membaca bibir. Ketika orang asing menanyakan arahan dalam bahasa yang dia gunakan sebagai bahasa Inggris, seorang pria muda datang membantunya dan menarik perhatian Yuki. Ceritanya berkisar pada Yuki saat dia menceritakan dunianya yang sunyi, dan orang-orang di sekitarnya.');
INSERT INTO `buku` (`Id_Buku`, `Judul`, `Penulis`, `Penerbit`, `Tahun_Terbit`, `Cover`, `Deskripsi`) VALUES
(22, 'chainsawman ', 'tatsuki fujimoto', 'shueisha', '2018-12-03', , 'Ceritanya berlatar dunia di mana Iblis (悪魔, Akuma) lahir dari ketakutan manusia. Namun, individu yang disebut Pemburu Iblis (デビルハンター, Debiru Hantā) mengkhususkan diri dalam berburu dan mempekerjakan mereka. Peristiwa tersebut terjadi pada tahun 1997, dalam garis waktu alternatif dimana Uni Soviet masih ada, dan banyak peristiwa seperti Holocaust, AIDS dan senjata nuklir telah terhapus dari sejarah karena konsumsi Iblis masing-masing oleh Iblis Gergaji, dengan hanya empat Iblis kuat yang dikenal sebagai Penunggang Kuda (Kontrol, Perang, Kelaparan, dan Kematian) mengingat kejadian tersebut. Manusia bisa membuat kontrak dengan Iblis melalui pengorbanan, sehingga mereka bisa menggunakan kekuatan Iblis. Iblis juga bisa menjadi Iblis dengan merasuki mayat manusia. Ketika Iblis terbunuh di Bumi, ia muncul kembali di Neraka, dan jika ia terbunuh di Neraka, ia bereinkarnasi dalam tubuh baru di Bumi.');
INSERT INTO `buku` (`Id_Buku`, `Judul`, `Penulis`, `Penerbit`, `Tahun_Terbit`, `Cover`, `Deskripsi`) VALUES
(23, 'death note', 'tsugumi ohba', 'shueisha', '2003-12-01', , 'Manga dan film layar lebar Death Note memiliki inti cerita yang sama yaitu kisah seorang siswa SMA terbaik se-Jepang bernama Light Yagami yang menemukan Death Note kepunyaan shinigami (dewa kematian) bernama Ryuk. Light merasa dunia sudah membusuk karena dipenuhi oleh manusia tidak berguna (penjahat), karena itu Light memutuskan untuk mengorbankan dirinya agar dunia menjadi lebih baik. Light membunuh para penjahat dengan julukan nama KIRA (Kira bandingkan dengan kata bahasa Inggris Killer), sayangnya Light menjadi tidak terkendali dan membunuh semua orang yang menghalanginya. Tidak butuh waktu lama nama KIRA mendunia. KIRA dikenal sebagai penjahat/pahlawan yang membuat para penjahat mati karena serangan jantung (Jika Light hanya menuliskan nama tanpa menuliskan detailnya maka orang-orang itu mati karena serangan jantung).');
INSERT INTO `buku` (`Id_Buku`, `Judul`, `Penulis`, `Penerbit`, `Tahun_Terbit`, `Cover`, `Deskripsi`) VALUES
(24, 'blue period', 'Tsubasa Yamaguci', 'kodansha', '2017-06-04', , 'Yatora Yaguchi adalah siswa yang cukup populer yang unggul di sekolah, tetapi sering berurusan dengan kekosongan batin dan frustrasi. Suatu hari ia sangat terpesona dengan lukisan di klub seni SMA-nya sehingga menginspirasinya untuk mencoba melukis. Kemudian dia terinspirasi oleh seorang teman Ryuji dan kemudian bergabung dengan klub seni, menjadi lebih terlibat secara mendalam, dan mencoba untuk mendaftar ke Universitas Seni Tokyo sebagai pilihan perguruan tinggi.');
INSERT INTO `buku` (`Id_Buku`, `Judul`, `Penulis`, `Penerbit`, `Tahun_Terbit`, `Cover`, `Deskripsi`) VALUES
(25, 'mob psyco 100', 'one', 'shagakugan', '2012-04-18', , 'Kageyama Shigeo merupakan pelajar biasa sekolah menengah pertama dengan nama panggilan \"Mob\" (モブ), dikarenakan kurangnya kehadirannya dalam ruang lingkup pergaulannya di sekolah. Meskipun terlihat seperti orang biasa, ia memiliki kekuatan supernatural Esper yang luar biasa. Dengan kekuatannya, ia yang menjadi murid seseorang yang mengaku Cenayang itu, turut membantu orang - orang yang mengalami gangguan supernatural. Mob yang mempunyai kekuatan luar biasa itu sering kali kehilangan kesadaran akan kekuatan itu sendiri, hingga akhirnya ia menyadari betapa mengerikannya kekuatannya itu. Mob yang ingin menjalani kehidupan sebagai orang normal seperti yang lainnya, selalu terhalang oleh masalah - masalah yang menghampirinya.');
INSERT INTO `buku` (`Id_Buku`, `Judul`, `Penulis`, `Penerbit`, `Tahun_Terbit`, `Cover`, `Deskripsi`) VALUES
(26, 'naruto', 'kishimoto', 'shueisha', '1999-09-01', , 'Cerita dimulai ketika seekor monster rubah ekor sembilan atau disebut Kyuubi menyerang Konoha, sebuah desa shinobi yang terletak di negara Api. Kekacauan terjadi di desa Konoha dan korban banyak berjatuhan. Akhirnya ada seseorang yang berhasil melenyapkan Kyuubi dengan menyegel sebagian chakra Kyuubi itu ke tubuhnya sendiri dan sisanya disegel ke tubuh Naruto, orang yang berhasil menyegel monster rubah ekor sembilan itu dikenal sebagai Yondaime Hokage, Hokage ke-4 atau Minato Namikaze yang tidak lain adalah ayah dari Naruto. Penyegelan itu menggunakan jurus Dewa Kematian sehingga risikonya adalah kematian Hokage ke-4 sendiri.');
INSERT INTO `buku` (`Id_Buku`, `Judul`, `Penulis`, `Penerbit`, `Tahun_Terbit`, `Cover`, `Deskripsi`) VALUES
(27, 'slam dunk', 'takehiko', 'shueisha', '1980-10-01', , 'Hanamichi Sakuragi adalah seorang berandalan yang telah 50 kali ditolak perempuan yang diminta untuk menjadi pacarnya. Ia kemudian bertemu Akagi Haruko, gadis idamannya yang mengajurkan Sakuragi untuk mencoba bergabung dengan tim basket SMA Shōhoku. Meskipun agak enggan karena tak mempunyai pengalaman bermain basket, Sakuragi memutuskan untuk bergabung agar dapat membuat Haruko terkesan dan membuktikan dirinya pantas untuk menjadi pacar Haruko. Kaede Rukawa, saingan Sakuragi baik dalam hal percintaan maupun di lapangan basket, bergabung pada saat yang sama. Hisashi Mitsui, mantan pemain terbaik di SMP, dan Ryota Miyagi keduanya juga bergabung dengan tim Shōhoku untuk mencapai impian sang kapten tim, Takenori Akagi untuk membawa Shōhoku menjadi juara nasional. Bersama-sama, kelimanya membentuk tim yang kuat dan Shōhoku yang sebelumnya tidak dikenal luas berubah menjadi salah satu calon juara. Kemudian mereka ikut dalam perlombaan antar SMU,untuk mencapai harapan takenori akagi mencapai juara nasional.mereka berlatih dengan giat,memasuki hari pertandingan sakuragi tak dapat tidur memikirkan pertandingan yang akan datang tersebut. Mereka berjuang dengan sekuat tenaga dan akhirnya team Shōhoku mendapatkan juara.');

